package shlm.lmcs.com.lazycat.LazyShopValues;/** * 新品上架的控件的Values */public class LocalNewshopIn {    private String title;    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }    public String getImg() {        return img;    }    public void setImg(String img) {        this.img = img;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    private String text;    private String img;    private String status;}